import React, { Component } from 'react'

class Counter extends Component {
    constructor(props){
        super(props)
         this.state = {
             count: 0
         }
    }
    incVal(){
        this.setState(this.state)
    }
    render() {
        return (
            <div>
                <h1>counting {this.state.count}</h1>
                <button onClick={() => incVal()}>add</button>
            </div>
        )
    }
}

export default Counter
